import React, { Component } from 'react'
import './Nav.css'
import { Link } from 'react-router-dom'
import PropTypes from 'prop-types'
import { connect } from 'react-redux'
import { logoutUser } from '../actions/authActions'
import M from 'materialize-css/dist/js/materialize.min.js'

class Nav extends Component {
  componentDidMount() {
    let sidenav = document.querySelector('#slide-out')
    M.Sidenav.init(sidenav, {})
  }

  onLogoutClick = (e) => {
    e.preventDefault()
    this.props.logoutUser()
  }

  render() {
    return (
      <div>
        <nav className="nav-extended">
          <Link
            className="brand-logo"
            style={{ color: '#fff', textDecoration: 'none' }}
            to="/menu"
          >
            <h3>Fithabit</h3>
          </Link>
          <Link
            href="#"
            data-target="mobile-demo"
            className="left sidenav-trigger"
          >
            <i className="material-icons">menu</i>
          </Link>
          <ul className="right hide-on-med-and-down">
            <Link
              style={{
                color: '#fff',
                textDecoration: 'none',
                listStyle: 'none',
                fontSize: '20px',
              }}
              to="/squat-ranking"
            >
              <li>Ranking</li>
            </Link>
            <Link
              style={{
                color: '#fff',
                textDecoration: 'none',
                listStyle: 'none',
                fontSize: '20px',
              }}
              to="/my-records"
            >
              <li>Record</li>
            </Link>
            <Link
              style={{
                color: '#fff',
                textDecoration: 'none',
                listStyle: 'none',
                fontSize: '20px',
              }}
              to="/profile"
            >
              <li>Profile</li>
            </Link>
            <Link
              onClick={this.onLogoutClick}
              style={{
                color: '#fff',
                textDecoration: 'none',
                listStyle: 'none',
                fontSize: '20px',
              }}
            >
              <li>Logout</li>
            </Link>
          </ul>
        </nav>

        <ul id="mobile-demo" className="sidenav">
          <Link
            style={{
              color: '#000',
              textDecoration: 'none',
              listStyle: 'none',
              fontSize: '20px',
            }}
            to="/squat-ranking"
          >
            <li>Ranking</li>
          </Link>
          <Link
            style={{
              color: '#000',
              textDecoration: 'none',
              listStyle: 'none',
              fontSize: '20px',
            }}
            to="/my-records"
          >
            <li>Record</li>
          </Link>
          <Link
            style={{
              color: '#000',
              textDecoration: 'none',
              listStyle: 'none',
              fontSize: '20px',
            }}
            to="/profile"
          >
            <li>Profile</li>
          </Link>
          <Link
            onClick={this.onLogoutClick}
            style={{
              color: '#000',
              textDecoration: 'none',
              listStyle: 'none',
              fontSize: '20px',
            }}
          >
            <li>Logout</li>
          </Link>
        </ul>
      </div>
    )
  }
}

Nav.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
}

const mapStateToProps = (state) => ({
  auth: state.auth,
})

export default connect(mapStateToProps, { logoutUser })(Nav)
